import React from "react";
import { Link } from "react-router-dom";

const Card = ({ dogs, page }) => {
  let display;
  console.log(dogs);

  if (dogs) {
    display = dogs.map((dog) => {
      let { id, name, image, temperaments, weight } = dog;
      return (
        <Link
          to={`${page}${id}`}
          key={id}
          className="col-lg-4 col-md-6 col12  mb-4 position-relative text-subtle"
        >
          <div>
            <img src={image} alt="img not found" width="200px" height="250px" />
            <h3>{name}</h3>
            <h5>{temperaments}</h5>
            <h5>{weight}</h5>
          </div>
        </Link>
      );
    });
  } else {
    display = " No Dogs Found :/";
  }

  return <>{display}</>;
};

export default Card;

